webpackJsonp([0xa9cd14843db3],{462:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Blog by Michael Lancaster",subtitle:"Software Engineer focused in Javascript applications",copyright:"© All rights reserved.",author:{name:"Michael Lancaster",twitter:"weblancaster"},url:"http://www.bymichaellancaster.com"}},markdownRemark:{id:"/Users/michaellancaster/Sites/github/michaellancaster-blog/src/pages/articles/2014-08-06-javascript-data-structure-algorithms-series-ep1/index.md absPath of file >>> MarkdownRemark",html:"<p>I don’t have officially a Computer Science degree.. But clearly nowadays you wont need a degree as engineer. You just need to be passionated to what you do and have that eager to learn and always evolve.</p>\n<p>That being said I have been always trying to learn and evolve to be better on what I do which I’m passionate about so here’s something else I’m improving.</p>\n<p>Web applications has evolved to a much complex system and with that Developers/Engineers are being “forced” to solve problems (could be the other way around) applying concepts of Computer Science which before you would just see on systems/programs using languages such as C, C++, Java and so on.</p>\n<p>What I want to do here it’s not just help me improve/evolve my knowledge also share the basics of Data Structures and Algorithms exploring some concepts with Javascript where what kind of Data Structure is more efficient than other or when certain Algorithm perform better than others.</p>\n<p>I’m not a Computer Scientist and this Series of posts wont be very advanced but I’m sure will be worthwhile.</p>\n<p>Cheers!</p>",fields:{date:"2014-08-06"},frontmatter:{title:"Ep.1 Data Structures and Algorithms with JS",description:"I don't have officially a Computer Science degree.. But clearly nowadays you wont need a degree as engineer. You just need to be passionate to what you do and have that eager to learn and always evolve."}}},pathContext:{slug:"/articles/2014-08-06-javascript-data-structure-algorithms-series-ep1/"}}}});
